column48:
The Council of the London Borough of Redbridge (?the Authority?) invites Tenders from suitably experienced and qualified providers for the Contract for the Provision of an Accommodation Based Support Service for Rough Sleepers and the Single Homeless in the London Borough of Redbridge (?the Contract?). 

The Contract will commence on 1st October 2016 and, subject to satisfactory performance, will operate for a period of three (3) years, terminating at midnight on 30th September 2019 (?the Contract Period?). 

The maximum annual budget available for the Contract is £517,000. However, Tenders will be judged on value for money and lower priced Tenders will be considered where quality is assured. Any Tenders submitted above the allocated budget will not be accepted. 

The Contract is to provide supported accommodation for rough sleepers and single homeless people across thirty nine (39) units situated in three (3) hostels located within the London Borough of Redbridge. The three hostels will work together and with other statutory and voluntary agencies to provide a pathway from rough sleeping to independent living in the community and social inclusion. 


Additional information: Any Provider wishing to submit a Tender for the Contract may obtain the Contract Documents in accordance with the instructions below:
			
?	Register your organisation free of charge at www.londontenders.org;

?	Await acceptance. You will receive an e-mail confirming your username and password for the London Tenders Portal;

?	Use your username and password to log in to the London Tenders Portal and register your interest in the Contract;

?	Follow the guidance contained in the Instructions for Submission of a Tender; 

?	All Tenders must be submitted via the London Tenders Portal.

All questions, clarifications or interpretations relating to the Contract must be submitted by no later than 17:00 Hours (5:00 pm) on Friday 11th March 2016.

The closing date for receipt of completed Tenders is 17:00 Hours (5:00pm) on Friday 18th March 2016.  

London Borough of Redbridge.
